class DataTables {
    static data = []
    static async pushData(contentTables){
        contentTables.pop()
        contentTables.shift()
        DataTables.data = contentTables
    }
    static find(nomorBupot){
        return DataTables.data.filter(item => item[3] == nomorBupot)
    }
}

